const axios =  require('axios');
const api = axios.create({
    baseURL: "http://localhost:1800/"
});

interface getSpots {
    data: spot[]
}

interface spot {
    coords: {
        coordX: number,
        coordY: number
    },
    _id: string,
    name: string,
    __v: number
}

const getOi = async (): Promise<anyu | Error> => {
    try {
        const { data } = api.get('/');
        if(data){
            return {
                data
            }
        }

        return new Error('n sei')
        
    } catch (error) {
        return new Error('erro de cu')
    }
}

export const Service = {
    getOi,
}
